import React from 'react';
import {Component} from 'react';
import {connect} from 'react-redux';
import comment from '../pics/comment.png';
import dislike from '../pics/dislike.png';
import like from '../pics/like.png';
import wall from '../actions/wall.js';

class WallElement extends Component{
  render(){
    return(
      <div className='profileWall'>
          <img src={dislike}/>
          <div className='profileWallText'>
            <p></p>
            <img src={like}/>
          </div>
          <div className=''>
            <button>{like}</button>
            <button>{dislike}</button>
            <button>{comment}</button>
          </div>
      </div>
    )
  }
}

export default connect(
  state =>({

  }),
  dispatch =>({
    onGetWall: url => {dispatch(wall(url))}
  })
)(WallElement)
